import { Component } from '@angular/core';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent {

}
<app-header></app-header>
<app-nav></app-nav>
<ul class="breadcrumb">
    <li><a href="#">Home</a></li>
    <li>Member Signup</li>
</ul>
<p>signup works!</p>
<app-footer></app-footer>
